import React from "react";
import { BrowserRouter } from "react-router-dom";
import { createGlobalStyle } from "styled-components";
import Main from "./pages/Main/Main";
const GlobalStyle = createGlobalStyle`
  body{
    margin:0;
    padding:0;
  }
`;

function App() {
  return (
    <BrowserRouter>
      <GlobalStyle />
      <Main />
    </BrowserRouter>
  );
}

export default App;
